INSERT INTO `aboutus` (`id`, `type_id`, `about_us`, `image`) VALUES
(8, 4, '<h1>History Of Academy</h1>\r\n<p>In the past 5 years, more than 375 job seekers have been recruited in various armed forces through our training academy in Karnataka. In 2019 alone, 62 candidates got recruited in various armed force categories Army, Navy, Air Force, Paramilitary, Police Forces etc. Dronas Academy has achieved a milestone success through its offline training that no one else can claim. Dronas Academy is the leading Pre-Recruitment Training Academy in India now. Our salient features are veterans of the Armed Forces who are providing training expertise to our students with a different approach.</p>\r\n<p>&nbsp;</p>\r\n<p>Dronas Academy can train you to clear the recruitment tests of Army, Navy, Air Force, Paramilitary and State Police Force. If you are aged between 16 and 23 years and having the basic qualification of 10th, 12th or Degree can apply for these training.</p>\r\n<p>&nbsp;</p>\r\n<p>If you are trained and can perform well in the entry level qualifying tests, then you will get your dream job in your first attempt itself. Dronas Academy has started a training program for the upcoming huge vacancies of Military, Paramilitary and Police Forces.</p>\r\n<p>&nbsp;</p>\r\n<p>If you are aged between 16 and 23 years, then you know, you are at your best time, being young and energetic you will have a golden opportunity to get a JOB in Army, Navy, Air Force, CRPF, CISF, CAPF, BSF ITBP, DELHI POLICE, RPF as well as in State Police Force, Excise, Forest Department etc.</p>\r\n<p>&nbsp;</p>\r\n<p>In this COVID-19 time, it has become difficult to find a good job, but a lot of government jobs are being created in defense for Military, Paramilitary and Police Forces every year. Now even sitting at home, you can take advantage of getting training and try for this opportunity with Dronas training.</p>\r\n<p>&nbsp;</p>\r\n<h1>Mission</h1>\r\n<p>&nbsp;</p>\r\n<p>The intellectual character and the moral value of students of Dronas Academy, is always kept high, as the same is required to maintain the status quo of integrity and commitments. Our mission helps the students to meet the challenged ambience with constant endurance and perseverance to lay an incredible landmark on our concrete planning of certainty. We provide adequate training and result oriented coaching by a group of well trained physical trainers and expert faculties so that the students remain physically fit and maintain an amicable balance between academic syllabus and strategic method of training. The mission works to build up the future career of youngsters in a constructive manner of creativity to achieve the impending career aspects as under:</p>\r\n<p>&nbsp;</p>\r\n<p>1.Students are taught and tackled by all means to become a soldier in the Armed forces, Coast Guard, paramilitary forces, Assam Rifles and the police force.</p>\r\n<p>&nbsp;</p>\r\n<p>2.Group discussions / debates help the students to acquire the deserving qualities of leadership which need a tough constitution. It also demands physical stamina, mental alertness and resilience of spirit. The intellect, sagacity, broad outlook and civic courage are maintained by one at the highest eminence in public life. The realization of one\'s self and his potential is the ultimate goal of personality which we tap to hone it. The under mentioned salient features of personality development are assessed among candidates which enable them to shine a star</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>1.Avoid failure fears</li>\r\n<li>&nbsp;</li>\r\n<li>2.Expecting perfection</li>\r\n<li>&nbsp;</li>\r\n<li>3.Team work and harmony with others</li>\r\n<li>&nbsp;</li>\r\n<li>3.Training and stamina: physical and mental, both</li>\r\n<li>&nbsp;</li>\r\n<li>4.Learn to forgive</li>\r\n<li>&nbsp;</li>\r\n<li>5.Learn to live in the present</li>\r\n<li>&nbsp;</li>\r\n<li>6.Eliminate procrastination</li>\r\n<li>&nbsp;</li>\r\n<li>7.Destiny is made by one\'s own shear hard work and perseverance</li>\r\n<li>&nbsp;</li>\r\n<li>8.Moral value and inspiration</li>\r\n<li>&nbsp;</li>\r\n<li>9.Command and control</li>\r\n<li>&nbsp;</li>\r\n<li>10.To maintain always a positive attitude towards life</li>\r\n<li>&nbsp;</li>\r\n<li>11.Planning and organizing qualities</li>\r\n<li>&nbsp;</li>\r\n<li>12.Social adjustment</li>\r\n<li>&nbsp;</li>\r\n<li>13.Dynamic qualities like adaptability in all odd situations</li>\r\n<li>&nbsp;</li>\r\n<li>14.Socializing quality</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>3.The Impact of methodical study including theoretical / practical special coaching, training and curriculum activities help the students to widen their vision including outlook and intellect. Besides, maximum stress on preparation / practice of competitive exams is given for facing any odd challenges more efficiently. Our mission would continue to proceed with strong determination for achieve the goal of success and shall leave no stone unturned at any given moment of time in life.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>1.Stop fearing failure</li>\r\n<li>&nbsp;</li>\r\n<li>2.Expecting perfection</li>\r\n<li>&nbsp;</li>\r\n<li>3.Team work and unity</li>\r\n<li>&nbsp;</li>\r\n<li>4.Training and stamina</li>\r\n<li>&nbsp;</li>\r\n<li>5.Learn to forgive</li>\r\n<li>&nbsp;</li>\r\n<li>6.Live in the present</li>\r\n<li>&nbsp;</li>\r\n<li>7.Eliminate procrastination</li>\r\n<li>&nbsp;</li>\r\n<li>8.Destiny at the Top</li>\r\n<li>&nbsp;</li>\r\n<li>9.Moral value and inspiration</li>\r\n<li>&nbsp;</li>\r\n<li>10.Command and control</li>\r\n<li>&nbsp;</li>\r\n<li>11.To maintain positive attitude</li>\r\n<li>&nbsp;</li>\r\n<li>12.Planning and organising qualities</li>\r\n<li>&nbsp;</li>\r\n<li>13.Social adjustment</li>\r\n<li>&nbsp;</li>\r\n<li>14.Dynamic qualities</li>\r\n<li>&nbsp;</li>\r\n<li>15.Social effectiveness</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>4.The Impact of methodical study including Physical training, Yoga, Meditation, Sports, Games and Academic classes help the students to widen their broad outlook and intellect. Besides, maximum stress on preparation / practice of competitive exams is given for facing any such challenges more efficiently. Our mission would continue to proceed with strong determination for achieving the goal of success and shall leave no stone behind at any turning point of crucial confrontations.</p>\r\n<p>&nbsp;</p>\r\n<table class=\"table\">\r\n<tbody>\r\n<tr>\r\n<th>The Nation:</th>\r\n<td>The Nation\'s honor and interest comes first, always and every time.</td>\r\n</tr>\r\n<tr>\r\n<th>The Services:</th>\r\n<td>We pledge to maintain the traditions of the Dronas Career Academy and keep them always bright and strong.</td>\r\n</tr>\r\n<tr>\r\n<th>The Academy:</th>\r\n<td>We are proud of the Academy of Pre-Recruitment Training. We will at all times endeavour to uphold its reputation by our conduct, bearing and manners both within and outside the campus.</td>\r\n</tr>\r\n<tr>\r\n<th>The Houses of Candidates :</th>\r\n<td>We are a family. We are loyal to each other. We act as one single entity.</td>\r\n</tr>\r\n<tr>\r\n<th>Truth:</th>\r\n<td>We will always follow the harder right rather than the easier wrong.</td>\r\n</tr>\r\n<tr>\r\n<th>Discipline:</th>\r\n<td>We will obey all orders at once. We will never leave a task unless permitted to do so by a superior.</td>\r\n</tr>\r\n<tr>\r\n<th>Punctuality:</th>\r\n<td>We will make punctuality our second nature.</td>\r\n</tr>\r\n<tr>\r\n<th>Supervision:</th>\r\n<td>We will work without any need of supervision. Supervision is unnecessary when duty is performed conscientiously.</td>\r\n</tr>\r\n<tr>\r\n<th>Work and Play:</th>\r\n<td>We will work hard and play hard. We will keep ourselves physically fit, mentally alert and morally upright.</td>\r\n</tr>\r\n<tr>\r\n<th>Gentlemen:</th>\r\n<td>As future sentinels of our nation we will learn to conduct ourselves as gentlemen. Done</td>\r\n</tr>\r\n</tbody>\r\n</table>', '8.png'),
(9, 3, '<p dir=\"ltr\">Drona\'s Career Academy training is designed to provide students with access to opportunities and tools to succeed in entrance tests in Defence (Army, Navy, Airforce), RPF, State police and all paramilitary forces. Through personalized learning experiences, students learn and master skills needed for the rigorous work of recruitment. To maintain consistent and high quality results, Drona\'s Career Academy tracks students\' performance and outcomes with a balanced Scorecard)</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\">There are approximately 40 different types of entries including Technical and Non Technical for both Boys and Girls into the Armed Forces (Army, Navy and Air Force). These range from an age group of 16 years to 45 years including Service Entries and TA and the qualifications ranging from 10+2 up to Post-Graduates level. 90% of the people are not aware of these entries and only come to know about them when they have crossed the qualifying age.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\">To create awareness amongst the youth &amp; guide them about the various career options open to them to join the Army, Navy, Air Force, RPF, State Police and Paramilitary forces.</p>\r\n<p>&nbsp;</p>', '7.png'),
(10, 6, '<p>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>\r\n<p>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>\r\n<p>Hum chalen nek raste pe hamse</p>\r\n<p>Bhoolkar bhi koi bhool ho na</p>\r\n<p><br>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>\r\n<p>Hum chalen nek raste pe hamse</p>\r\n<p>Bhoolkar bhi koi bhool ho na</p>\r\n<p>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>\r\n<p><br>Door agyaan ke hon andhere</p>\r\n<p>Tu hamein gyan ki roshni de</p>\r\n<p>Har buraai se bachte rahen hum</p>\r\n<p>Jitni bhi de bhali zindagi de</p>\r\n<p>Bair ho na kisi ka kisi se</p>\r\n<p>Bhawana man mein badle ki ho na</p>\r\n<p>Hum chalen nek raste pe hamse</p>\r\n<p>Bhoolkar bhi koi bhool ho na</p>\r\n<p>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>\r\n<p><br>Hum na sochen hamen kya mila hai</p>\r\n<p>Hym yeh sochen kiya kya hai arpan</p>\r\n<p>Phool khushiyon ke baaten sabhi ko</p>\r\n<p>Sabka jeevan hi ban jaaye madhuban</p>\r\n<p>O apni karuna ko jal tu baha ke</p>\r\n<p>Kar de paavan har ik man ka kona</p>\r\n<p>Hum chalen nek raste pe hamse</p>\r\n<p>Bhoolkar bhi koi bhool ho na</p>\r\n<p>Itni shakti hame dena data</p>\r\n<p>Man ka vishwas kamzor ho na</p>', '15.png');
