(1, '2', 'Best Army Technical Coaching In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>The technical entries in the Indian Armed forces are a dream of many. Well, there is nothing special required to join the Indian Army Technical Branch. All you need is the right mentor, the right study material, the right guidance, and better preparation, etc. Well, to clear the selection stages of the Indian Army Technical entry, you need to join the Best Army Technical Coaching in India to get prepared well for your examination. Let&rsquo;s see the exam details, required eligibility criteria and its complete selection process, etc.</strong></p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Technical Exam Details:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"299\"><col width=\"293\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Exam</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Army (Technical Entry)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Availability of Forms</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Once A Year</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Required Qualification</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">A candidate must be passed class 12th with PCM with at least 50% &amp; 40% marks in each subject.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Age Limit</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">17 &frac12; &ndash; 23 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Who can Apply</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Fresher</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Height Required</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">162cm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Relaxation Criteria</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">There is no relaxation given to anyone regarding anything except height. North-eastern region candidates get some relaxation in height.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Through the Indian Army Technical Entry, One becomes eligible to join the Technical Branch of the Indian Army. The Selection Process is not that easy. It takes a lot to clear the selection phase.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Technical Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">All the candidates who apply for this will appear for the following rounds of selection which is under the selection authority at the Army Selection Center.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Medical Examination</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Written Examination</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Process is tough and needs proper preparation. The Selection in this is purely based on the performance in the Physical Fitness Test. Under the Physical Fitness Test, One will appear for the different types of physical activities. If you are looking for the Best Army Technical Exam Coaching in India, Join the Drona Academy. It is the finest Institute for training and education. The team of officers and physical trainers will make you eligible to clear the exam.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Technical Physical Fitness Test:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There are some physical fitness tests are conducted for the selection and on the basis of the performance in the test, one gets the marks. Here is the list of activities that one has to appear:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1. Running of &nbsp; 1.6km</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Push-Ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Sit-ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Zig-Zag Balance</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5.Ditch Jump 9fit&nbsp; etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The competition is too much in this. You will need to prepare much better in order to clear this. Join the Best Army Technical Coaching Center in India to get prepared well for your examination. Once you clear this round, all the selected candidates will proceed for the medical exam at the reputed Indian Army hospital. The Medical can be tough to clear as well if you are not aware of your body condition. The Drona&rsquo;s Academy conducts the Medical test on its own to check the medical condition of his/her students. It is very important to be sure that you are medically and physically fit in every manner to join the Indian Army Service.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Technical Written Exam:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Once you clear the Physical Fitness Test and Medical Exam, All the qualified candidates will appear for the Written Exam. The Written Exam is not that tough to clear. All the questions that will be asked in the examination will be based on the syllabus up to class 10th. A candidate has to focus more on the basics. Well, the rising competition in this field and mode is hard. One will have to score much better to clear final cutoff marks. It is suggested that join the Best Coaching for Army Technical Exam in India to get prepared at best. The paper pattern of the Written Exam would be like this:</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"202\"><col width=\"197\"><col width=\"192\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">No. of Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks Allotted</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.General Knowledge</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Mathematics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">15</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">30</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Chemistry</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Physics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">15</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">30</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">50</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Technical Written Exam Syllabus:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing in the syllabus from the outside. All the questions will be asked till the 10th level. But Drona Academy has designed the dedicated book for the Army Technical Examination. It becomes very easy to prepare through the Drona Academy study materials. One has to prepare the following subjects for the written exam.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.General Knowledge</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Mathematics</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Physics</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Chemistry etc</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Join Drona&rsquo;s Academy For Army Technical Exam Preparation:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Join the Best Indian Army Technical Coaching in India to get trained well for your examination. The Drona&rsquo;s Academy has proper training facilities. We have a team of Ex-Defence Officers and Trainers for the training and education. There is nothing that we left in the preparation. Join our course, work hard and clear your exam on the very first attempt.</p>', '750px3.png'),
(3, '3', 'Best Assam Rifles Coaching In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>The Indian Army has a number of regiments and each regiment has its own duty, responsibility and way of working etc. The Assam Rifles is one of the regiments of the Indian Army and the vacancy is released separately to recruit the soldiers, clerks, technicians and other posts etc. The Selection is not as easy, one has to prepare in every manner to clear the selection stages. Join the Best Assam Rifles Coaching in India for the proper training and education. Here are the details about the Exam, Eligibility Criteria and complete selection process etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Exam Details:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"283\"><col width=\"308\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Exam Conduction Authority</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Directorate General Assam Rifles</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Post Names</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Tradesman and Technical Post (Group B and C) etc</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Application Mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Defence Jobs</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Eligibility</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th/12th pass</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Selection Process</p>\r\n</td>\r\n<td>\r\n<ol>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Physical Test</p>\r\n</li>\r\n</ol>\r\n<br>\r\n<ol start=\"2\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Written Test</p>\r\n</li>\r\n</ol>\r\n<br>\r\n<ol start=\"3\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Skill Test</p>\r\n</li>\r\n</ol>\r\n<br>\r\n<ol start=\"4\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Medical Test</p>\r\n</li>\r\n</ol>\r\n<br>\r\n<ol start=\"5\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Merit List</p>\r\n</li>\r\n</ol>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Official Site</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.assamrifles.gov.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Eligibility Criteria:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There are a number of vacancies released by the Assam Rifles Authority for the selection of candidates for different branches and posts within the service. Here are the details of the required educational qualification and age limit etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Vacancy is released every year and the Physical test is the leading phase of selection and only candidates will be allowed for the further phases those who would clear the Physical Fitness Test. One needs to have the best training under certified Trainers and Instructors. The Dronas Academy&nbsp; is the Best Assam Rifles Coaching Institute in India for the preparation of the Assam Rifles Examinations. Here are the details about the Physical Standard that one must match in every manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Physical Standard Test:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"155\"><col width=\"158\"><col width=\"137\"><col width=\"143\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Parameters</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Male</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Female</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">Height</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">GEN/OBC/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">170 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">157 cm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">ST</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">162.5 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">150 cm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">Chest Expansion (Only for Males)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">GEN/OBC/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">80 &ndash; 85 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Nil</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">ST</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">78 &ndash; 83 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Nil</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the candidates is done in the four stages of selection. One has to clear the following rounds to get clear the exam:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Written Examination</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Skill Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Medical Test etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Physical Fitness Test is the first and leading phase of selection. In this test, one has to appear for physical activities like Running, Push-ups, Pull-ups etc and more. Here are the PFT running details:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"198\"><col width=\"201\"><col width=\"193\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Gender</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Distance</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Time</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Male</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">5 km</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">24 min</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Female</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 km</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">8.3 min</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Join the Best Assam Rifles Coaching Center in India that could train you in every manner and make you able to clear the exam. The Dronas Academy&nbsp; have a team of Ex-Defence Officers, Examiners, Physical Trainers, and qualified teachers for the training and education. Well, let&rsquo;s see the Written Exam Pattern:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Written Exam Pattern:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">After the Physical Fitness Test, Every selected candidate will proceed for Written Exam. It is important to clear each phase individually to be considered for the All India Merit List. The Selection is not that easy if you have the aim of joining Assam Rifles. All the candidates who will clear the physical fitness test to proceed for the written examination that is conducted under the Assam Rifles Selection Authority. Here is the exam pattern of Assam Rifles.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"270\"><col width=\"150\"><col width=\"82\"><col width=\"90\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">English Language</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td rowspan=\"5\">\r\n<p dir=\"ltr\">2 hours</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Reasoning Ability</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Quantitative Aptitude</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">General Awareness</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Exam is conducted offline and each question would be carrying one mark. One needs to prepare very better in order to clear the examination. The Dronas Academy&nbsp; has its own publication of books and has designed the best book for the Assam Rifles written examination. The Books has been designed by the defence examiners and it is very helpful for our students.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Dronas Academy&nbsp; has given the maximum selection in the Defence every year. Join the Best Assam Rifles Written Exam Coaching in India. Join the Dronas Academy&nbsp; and get yourself trained well for the physical fitness test, written exam and all other rounds of selection. Be the part of winners and reach your dream goal. Here are the details about the Dronas Academy&rsquo;s Course.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 'Screenshot_2.png'),
