r=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Male Safai</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th pass</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Cook (Male)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th pass</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Personal Assistant (Male/Female)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">12th pass with Dictation</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Barber (Male)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th pass</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Bridge &amp; Road (Male &amp; Female)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Diploma in Civil Engineering</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Electrician Fitter Signal</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th pass</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18 to 23</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Vacancy is released every year and the Physical test is the leading phase of selection and only candidates will be allowed for the further phases those who would clear the Physical Fitness Test. One needs to have the best training under certified Trainers and Instructors. The Dronas Academy&nbsp; is the Best Assam Rifles Coaching Institute in India for the preparation of the Assam Rifles Examinations. Here are the details about the Physical Standard that one must match in every manner.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Physical Standard Test:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"155\"><col width=\"158\"><col width=\"137\"><col width=\"143\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Parameters</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Male</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Female</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">Height</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">GEN/OBC/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">170 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">157 cm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">ST</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">162.5 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">150 cm</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">Chest Expansion (Only for Males)</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">GEN/OBC/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">80 &ndash; 85 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Nil</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">ST</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">78 &ndash; 83 cm</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Nil</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the candidates is done in the four stages of selection. One has to clear the following rounds to get clear the exam:</p>\r\n<ul style=\"text-align: justify;\">\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Physical Fitness Test</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Written Examination</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Skill Test</p>\r\n</li>\r\n<li dir=\"ltr\" aria-level=\"1\">\r\n<p dir=\"ltr\" role=\"presentation\">Medical Test etc.</p>\r\n</li>\r\n</ul>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Physical Fitness Test is the first and leading phase of selection. In this test, one has to appear for physical activities like Running, Push-ups, Pull-ups etc and more. Here are the PFT running details:</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"198\"><col width=\"201\"><col width=\"193\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Gender</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Distance</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Time</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Male</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">5 km</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">24 min</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Female</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 km</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">8.3 min</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Join the Best Assam Rifles Coaching Center in India that could train you in every manner and make you able to clear the exam. The Dronas Academy&nbsp; have a team of Ex-Defence Officers, Examiners, Physical Trainers, and qualified teachers for the training and education. Well, let&rsquo;s see the Written Exam Pattern:</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Assam Rifles Written Exam Pattern:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">After the Physical Fitness Test, Every selected candidate will proceed for Written Exam. It is important to clear each phase individually to be considered for the All India Merit List. The Selection is not that easy if you have the aim of joining Assam Rifles. All the candidates who will clear the physical fitness test to proceed for the written examination that is conducted under the Assam Rifles Selection Authority. Here is the exam pattern of Assam Rifles.</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"270\"><col width=\"150\"><col width=\"82\"><col width=\"90\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">English Language</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td rowspan=\"5\">\r\n<p dir=\"ltr\">2 hours</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Reasoning Ability</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Quantitative Aptitude</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">General Awareness</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Exam is conducted offline and each question would be carrying one mark. One needs to prepare very better in order to clear the examination. The Dronas Academy&nbsp; has its own publication of books and has designed the best book for the Assam Rifles written examination. The Books has been designed by the defence examiners and it is very helpful for our students.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Dronas Academy&nbsp; has given the maximum selection in the Defence every year. Join the Best Assam Rifles Written Exam Coaching in India. Join the Dronas Academy&nbsp; and get yourself trained well for the physical fitness test, written exam and all other rounds of selection. Be the part of winners and reach your dream goal. Here are the details about the Dronas Academy&rsquo;s Course.</p>', ''),
(9, '5', 'Best Army Clerk Coaching Online:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>The Indian Army Clerk is the most demanding post in the service at the GD level. Most of them apply for this every year, only a few get to clear this. This all happens only because of a lack of preparation. The Selection stages of the Indian Army are considered the toughest. One has to prepare in all possible manners to get clear the physical fitness test and written exam which are major rounds of selection. The Drona\'s Academy has launched the Indian Army Clerk Coaching Online to provide better preparation to the candidates and make them all able to clear the selection stages in very rounds. Join the Drona\'s Academy Online portal and get better prepared for your exam. Now let&rsquo;s see the details about the Selection Process and complete required eligibility criteria etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Clerk Eligibility Criteria:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"230\"><col width=\"361\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Educational Qualification</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">A candidate must have passed 10+2 in Maths and Accounts (Science or Commerce) with at least 55% marks.</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Nationality</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Must be a citizen of India</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Age Limit</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">17.5 years old to 25 years old</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Number of Attempts</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Until Crossing the Age Limit</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Marital Status</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Must be an Unmarried</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Experience</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">No prior experience is required.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing much required to apply for the Indian Army Clerk Vacancy. Well, but the selection stages are tough. Join the Army Clerk Coaching Online and get better preparation for the physical fitness test and written examination. Now let&rsquo;s see the complete selection process of the Indian Army Clerk vacancy.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Clerk Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Process of the Indian Army Clerk is done in the following phases and it is mandatory to clear each phase of selection.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Documents verification</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Medical Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Written Exam etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the soldier&rsquo;s in the Indian Army is done through the Army Direct Recruitment or commonly known as the Rally Bharti. Well, the selection is tough as there is huge competition in this field. Join the Best Army Clerk Coaching Online that could train you for the Physical Fitness Test, written exam and give you better guidance to clear the exam. Here are the details about the Physical Fitness Test and Written Examination.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Clerk Physical Fitness Test:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, the Physical fitness test plays an important role in the selection. Around 70% of selection depends on this phase of selection. A candidate will appear for the physical activities and on the basis of their performance, candidates will be given marks.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Running 1.6km</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Push-Ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Sit-ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Zig-Zag Balance</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5. Ditch 9fit Jump etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, you must join the Drona\'s Academy which is the leading Defence Institute in India and provides the best training and education. For the better preparation of the Written Examination, Join the Online Classes for Army Clerk that has been launched by the Drona\'s Academy Exam Experts to give the best preparation to the students.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army Written Exam Pattern:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There are two papers in the written examination. As with other defence examinations, the Indian Army Soldier Clerk examination is also different. Here is the paper pattern of the I &amp; II etc.</p>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">Part: 1 Paper Exam Pattern</h3>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"202\"><col width=\"197\"><col width=\"193\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.General Knowledge</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">05</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">2.General Science</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">05</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Mathematics</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">40</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Computer Science</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">05</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h3>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">Part: 2 Paper Exam Pattern</h3>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"196\"><col width=\"200\"><col width=\"196\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Number of Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Number of Marks</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.General English</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing much in the syllabus of the Indian Army Clerk Written Examinations. One just has to be clear with the basics. The Drona\'s Academy Online Courses for Army Clerk has been designed in a manner to provide better preparation and guidance for the Physical Fitness Test and Written Exam etc. Here are the details about the Drona\'s Academy Online Courses.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Join The Drona\'s Academy For Army Clerk:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>', '6a602ce8f41dfc33681199b4f4517a541.jpg');
