(10, '6', 'Best Airforce X Group Coaching In India:', '<p style=\"text-align: justify;\"><strong id=\"docs-internal-guid-34d6f211-7fff-08dc-c019-290bbc299cca\">The Indian Airforce conducts the X and Y group examination for the selection of the Airmen into the service. The X group is conducted for the selection of technical candidates. The trade of the Indian Airforce is in high demand and it is also tough to clear its selection process to get selected. You must join the best Air force X group coaching in India that could prepare you in every manner and make you able to clear the exam. The Drona\'s Academy provides quality education and training to clear the Air force X group selection stages. Well, let&rsquo;s see some details about the exam, eligibility and its complete selection procedure.</strong></p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force X Group Vacancy Highlights:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"275\"><col width=\"317\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Name of the Exam</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Airmen Recruitment Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Posts</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Group X Posts</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Recruiting Body</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">CASB - Central Airmen Selection Board</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Mode of Application</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Frequency of Exam</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Twice a Year</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Mode of Exam</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Application Fees</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Rs.250/-</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Official Website</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.airmenselection.cdac.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The X group is the technical entry and there may be some extra requirements in the eligibility criteria section. Let&rsquo;s see the details about the eligibility criteria of Air force X Group</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force X Group Eligibility Criteria:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Educational Qualification for Group X (Except Education Instructor Trade): One must have passed class 12th Maths, Physics &amp; English with 50% marks or one must have passed three years of diploma courses in engineering in any stream with 50% marks.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Age Limit: 17 years old to 23 years old. Age should be at least 17 while applying Online and it should not be more than 23 years on the date of commencement of the course.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">A candidate must be medically and physically fit in every manner. There is no relaxation for anyone in the educational qualification, age limit or in medical criteria. There is nothing much in the preparation of the Airforce X group Examination but due to the competition, it has become tough. Well, it is all about your future and career so join the Best Air force X Group Coaching Center in India that could prepare you for every phase of Group X selection and make you able to clear it. Let&rsquo;s see the Air force X group selection procedure:</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force X Group Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Process of the Air force X Group is done in three phases. A candidate will have to appear for the following phases:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Phase-I-Written Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Phase-II-Document Verification</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Phase-III-Medical Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Written Exam is the toughest phase of selection. It is not that easy to clear the Written Examination. One will have to prepare in a very well manner to beat the competition and crack the written test. Join Drona\'s Academy, the Best Air force X Group Written Exam Coaching in India to get trained well for your examination. Our Institute has done extremely well in the field of defence. We are known for giving selection into the Indian Armed forces in the past few years.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force X Group Written Exam Pattern:</h2>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"204\"><col width=\"190\"><col width=\"197\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Name of the subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Exam Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.English</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20</p>\r\n</td>\r\n<td rowspan=\"3\">\r\n<p dir=\"ltr\">60 Minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Physics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Mathematics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The X Group covers the technical side of the Air force. After Selection through the Air force, X group and gets into the technical branch of the Indian Air force and works as a Technician, Assistant Engineers and other technical aspects related posts etc. The written test is tough. If you are opting for the X group make sure that your physics and mathematics are good enough. If not, then join Drona\'s Academy which are known as the Best Indian Air force X Group Coaching in India. At the Drona\'s Academy, You will get proper training and education and our team will make you clear the selection process.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Air Force X Group Exam Preparation At Drona\'s Academy:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Drona\'s Academy is a top reputed institute in India for defence exam preparation. All the candidates who want to prepare for the Airmen Examination must join the Drona\'s Academy. We have a team of Ex-Air force Officers and Ex-Interviewers for the training and education. Our Institute has its own publication of books and our experts have designed the best for the Airforce X group exam preparation. Well, there is no shortcut to getting selected. You have to work hard in the right manner. Our team is here to guide and will make you eligible to clear the selection stages in a first attempt. Join the Best Air force X Group Coaching and get prepared much better than other candidates. Here are the details of the courses.&nbsp;</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 'teahub_io-air-force-wallpaper-517981.jpg'),
(11, '7', 'Best Air Force Y Group Coaching In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>To become an Airmen in the Indian Air Force right after passing class 12th. One can apply for Air Force X and Y Group Examination. The vacancy is released for the selection of the Technical and Non-technical candidates which is X Group and Y Group respectively. The competition to become an Airman is too much. Every candidate who is interested in the Indian Armed Forces appears for the examination. You have to prepare in such a manner to beat the competition by scoring good enough marks. Join the best Air force Y Group Coaching in India that could prepare you for its selection phases. Let&rsquo;s see the details about Airmen vacancy details, required eligibility criteria and complete selection process etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Air Force Y Group Vacancy Highlights:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"275\"><col width=\"317\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Name of the Exam</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Airmen Recruitment Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Posts</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Group Y Posts</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Recruiting Body</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">CASB - Central Airmen Selection Board</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Mode of Application</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Frequency of Exam</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Twice a Year</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Mode of Exam</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Application Fees</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Rs.250/-</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">8.Official Website</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.airmenselection.cdac.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force Y Group Eligibility Criteria:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.A candidate just needs to have passed class 12th in any stream from any government-recognized board.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Age between 17 years old to 21 years old.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Age should be at least 17 while applying Online and it should not be more than 21 years on the date of commencement of the course.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Educational Qualification:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">To apply for the vacancy, a candidate needs to be medically and physically fit in every manner. If even a minor defect is found in your body while medical, it can be a good reason for rejection. At the Drona\'s Academy, We conduct medical checkups for our students to make sure that they are fit and fine in every manner to clear the medical test. Join the best Air force Y Group Coaching Center in India that could prepare you for everything and be at your back to help you regarding studies, doubts and guidance. Now let&rsquo;s see the selection phases of Air force Group Y.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force Y Group Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The vacancy for the Air force X group and Y group are released the same and the selection process is also the same. The Selection stages of the Air force Y Group are consists of the following:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Medical Test etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">You have to prepare for all these in a good manner to score better. None of the phases is easy. To get to the physical fitness test, you have to clear a written exam. Most of the candidates get rejected for the written exam. Join the best Air force Y Group Written Exam Coaching in India to get prepared for it at best. Let&rsquo;s see the details about the Written Exam Pattern.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Air Force Y Group Written Exam Pattern:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"191\"><col width=\"201\"><col width=\"199\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Exam</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Total Time Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">1.OMR Based Paper</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.General English</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td rowspan=\"2\">\r\n<p dir=\"ltr\">45 Minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Reasoning &amp; General Awareness (RAGA)</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Written Exam is easy for the one who has prepared well and has the right mentor to guide them. There is a number of coaching&rsquo;s available in India but choosing the best one can shape your future. Join the Best Air force Y Group Coaching Institute in India, the Drona\'s Academy and get trained under the guidance of the Ex-Air Force Officers and Examiners. You will get proper guidance regarding the written exams, physical fitness tests as well as for the medical examination etc.</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Drona\'s Academy For Air Force Y Group Preparation:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Drona\'s Academy has the best training faculty and best teachers for the training and education. Our aim is to train our students in every manner and them eligible to clear the exam. There is nothing in the preparation that we left and could stop you from the selection. Under our course we provide:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Regular physical training sessions</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Monthly unit test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Online test series</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Monthly Parent Teacher Meeting</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5.Doubt removal classes</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">6.Orientation sessions</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">7.Regular Interaction with selected candidates</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">8.Physical Experts</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">9.Hostel Facility</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">10.Course strictly based on syllabus</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">11.Well researched Study Material etc&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Not just this, Drona\'s Academy has its own publication and we design our own books for preparation. Our Institute has given a maximum number of selections in the Armed forces in a year. Join the best Air force Y group coaching in India and prepare for your dream job at ease.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 'teahub_io-indian-air-force-fighter-2123980.jpg'),
(12, 'Select', 'Best Army GD Coaching In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>The recruitment of the soldiers in the Indian Army is done through the Rally Bharti. The Rally Bharti is basically an open Bharti and it has huge competition. It is very tough to get selected in the Indian Army through the Rally Bharti. For the best preparation of this, you need to join the Best Army GD Coaching in India that could prepare you in all manners and make you able to join the service. Let&rsquo;s see the details about the Exam Details, Eligibility Criteria, and its Selection Procedure etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army GD Eligibility Criteria:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"297\"><col width=\"294\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Age Limit</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">17.5 years old to 23 years old</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Educational Qualification</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Minimum qualification of 10th</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Nationality</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Must be a citizen of India</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Number of Attempts</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Until Age Limit</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Marital Status</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Must be an Unmarried</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Experience</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">No prior experience is required.</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Make sure that the candidate is medically and physically fit in every manner to apply for the vacancy. Let&rsquo;s see the complete selection procedure that a candidate has to clear to get selected.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army GD Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the candidates is done in a number of phases. All the candidates who apply for this will appear for the following rounds of selection which is under the selection authority at the Army Selection Center.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Checking of Documents</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Measurements</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Medical Examination</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5.Written Examination</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">6.Preparation of Merit List etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Process is tough and needs proper preparation. The Selection in this is purely based on the performance in the Physical Fitness Test. Under the Physical Fitness Test, One will appear for the different types of physical activities. If you are looking for the Best Indian Army GD Coaching in India. Join the Drona\'s Academy. Drona\'s Academy is the finest Institute for training and education. The team of officers and physical trainers will make you eligible to clear the exam.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army GD Physical Fitness Test:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There are some physical fitness tests are conducted for the selection and on the basis of the performance in the test, one gets the marks. Here is the list of activities that one has to appear:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Running 1.6km</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Push-Ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Sit-ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Zig-Zag Balance</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5.Ditch 9fit Jump etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The competition is too much competition in this. You will need to prepare much better in order to clear this. Join the Best Army GD Coaching Institute in India to get prepared well for your examination. Once you clear this round, all the selected candidates will proceed for the medical exam at the reputed Indian Army hospital.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Medical can be tough to clear as well if you are not aware of your body condition. The Drona\'s Academy conducts the Medical check-ups for the candidates. It is very important to be sure that you are medically and physically fit in every manner to join the Indian Army Service.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Army GD Written Exam Pattern:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\"