(14, '9', 'Best SSC GD Online Coaching:', '<p style=\"text-align: justify;\"><strong id=\"docs-internal-guid-99688da3-7fff-89a0-e524-4b901886fd76\">There are many ways to prepare for any examination. But the preparation at the academy or under the guidance of experts is always better. Well, now exams have more competition, the question paper isn&rsquo;t that tough but the competition is tough. But, it is not always possible for every candidate to join the academy and start their preparation. The Drona\'s Academy has launched the Online Coaching for SSC GD Exam preparation with the aim to give complete preparation for the exam at your home. You can study under the guidance of the officers and qualified teachers in your comfort zone. It becomes very easy for one to prepare better for the exam through the Drona\'s Academy SSC GD Online Classes. Join the Online Program and get prepared well for your examination. Now let&rsquo;s see details about the Exam details, Selection process and complete required eligibility criteria to apply for the vacancy.</strong></p>', '<p dir=\"ltr\" style=\"text-align: justify;\">SSC GD Exam Details:</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"266\"><col width=\"351\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Exam Conducting Body</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Staff Selection Commission (SSC)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Post Name</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Constable</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Vacancy</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25271</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Pay Scale</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Pay Level-3 (Rs 21700-69100)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Job Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Defence</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Online Application Mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Exam Mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">8.Exam Type</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">National Level Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">9.Job Location</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Across India</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">10.Age Limit</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18-23 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">11.Educational Qualification</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th Pass</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">12.Official Website</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.ssc.nic.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Required Eligibility Criteria for SSC GD:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">In order to be eligible to apply for the SSC GD vacancy. A candidate must have passed class 10th from any government recognized board. There is nothing much required in the educational qualification except this. Here are the age limit criteria and relaxation in age offered to the candidates as per the categories.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"386\"><col width=\"232\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Age Limit</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.OBC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">26 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.ST/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">28 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Ex-Servicemen:</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General: 26 years</p>\r\n<p dir=\"ltr\">OBC: 29 years</p>\r\n<p dir=\"ltr\">SC/ST: 3 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Children and dependent of victims&nbsp;</p>\r\n<p dir=\"ltr\">got killed in the 1984&nbsp;</p>\r\n<p dir=\"ltr\">Communal riots 2002 in Gujarat</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General: 28 years</p>\r\n<p dir=\"ltr\">OBC: 31 years</p>\r\n<p dir=\"ltr\">SC/ST: 33 years</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, these are the basic requirement to apply for the Indian Army SSC GD Vacancy. The exam is easy but you have to prepare all well to crack the competition. Join the SSC GD Constable Online Coaching and get the best preparation for the exam by sitting at your home.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Selection Process:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, the Indian Army has pretty much the same selection process for each entry in the service. The selection of the SSC GD soldiers will be done in the following stages:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Efficiency Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Physical Standard Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Medical Exam etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Exam is easy but then too the candidates are not able to clear it. It is all because of the lack of preparation. The Drona\'s Academy has launched the best Paramilitary Force Coaching Online to give better preparation to the students and make them able to clear the exam in the very first attempt. Let&rsquo;s see the pattern of the SSC GD Written Examination like the number of questions, subjects and overall timing given to finish the paper etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Written Exam Pattern:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing much in the written examination. A candidate just has to prepare the basics of class 6th to 10th in a competition exam manner. It is always easy to prepare for the academic exams as compared to the competitive examination. Join the Drona\'s Academy Online Coaching for SSC GD and get prepared for the exam in a better and effective manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"42\"><col width=\"246\"><col width=\"142\"><col width=\"120\"><col width=\"105\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Part</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Subject</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">A</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General Intelligence&nbsp;</p>\r\n<p dir=\"ltr\">Reasoning</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td rowspan=\"4\">\r\n<p dir=\"ltr\">90 minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">B</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General Knowledge&nbsp;</p>\r\n<p dir=\"ltr\">General Awareness</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">C</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Elementary Mathematics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">D</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">English/ Hindi</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Once a candidate clears the written exam, they will proceed for the Physical Fitness or Physical Efficiency test which is very commonly referred to as PFT.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Physical Efficiency Test:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"257\"><col width=\"188\"><col width=\"186\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\">\r\n<p dir=\"ltr\">Race</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Type</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Male Candidates</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Female Candidates</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Candidates other than&nbsp;</p>\r\n<p dir=\"ltr\">Ladakh Region</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">5 Km in&nbsp;</p>\r\n<p dir=\"ltr\">24 minutes</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 Km in&nbsp;</p>\r\n<p dir=\"ltr\">8(1/2) minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">For Ladakh Region,</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 Km in&nbsp;</p>\r\n<p dir=\"ltr\">6(1/2) minutes</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">800 metres in&nbsp;</p>\r\n<p dir=\"ltr\">4 minutes</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Drona\'s Academy provides better guidance for the Written Examination as well as for the Physical Fitness Test etc. Join SSC GD Online Classes of Drona\'s Academy and clear all your doubts related to the exam and be able to clear the selection stages of the SSC GD vacancy.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">SSC GD Exam Details:</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"266\"><col width=\"351\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Exam Conducting Body</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Staff Selection Commission (SSC)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Post Name</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Constable</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Vacancy</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25271</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Pay Scale</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Pay Level-3 (Rs 21700-69100)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Job Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Defence</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Online Application Mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Exam Mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Online</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">8.Exam Type</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">National Level Exam</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">9.Job Location</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Across India</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">10.Age Limit</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">18-23 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">11.Educational Qualification</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10th Pass</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">12.Official Website</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.ssc.nic.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Required Eligibility Criteria for SSC GD:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">In order to be eligible to apply for the SSC GD vacancy. A candidate must have passed class 10th from any government recognized board. There is nothing much required in the educational qualification except this. Here are the age limit criteria and relaxation in age offered to the candidates as per the categories.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"386\"><col width=\"232\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Category</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Age Limit</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.OBC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">26 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.ST/SC</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">28 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Ex-Servicemen:</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General: 26 years</p>\r\n<p dir=\"ltr\">OBC: 29 years</p>\r\n<p dir=\"ltr\">SC/ST: 3 years</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Children and dependent of victims&nbsp;</p>\r\n<p dir=\"ltr\">got killed in the 1984&nbsp;</p>\r\n<p dir=\"ltr\">Communal riots 2002 in Gujarat</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General: 28 years</p>\r\n<p dir=\"ltr\">OBC: 31 years</p>\r\n<p dir=\"ltr\">SC/ST: 33 years</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, these are the basic requirement to apply for the Indian Army SSC GD Vacancy. The exam is easy but you have to prepare all well to crack the competition. Join the SSC GD Constable Online Coaching and get the best preparation for the exam by sitting at your home.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Selection Process:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, the Indian Army has pretty much the same selection process for each entry in the service. The selection of the SSC GD soldiers will be done in the following stages:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Efficiency Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Physical Standard Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Medical Exam etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Exam is easy but then too the candidates are not able to clear it. It is all because of the lack of preparation. The Drona\'s Academy has launched the best Paramilitary Force Coaching Online to give better preparation to the students and make them able to clear the exam in the very first attempt. Let&rsquo;s see the pattern of the SSC GD Written Examination like the number of questions, subjects and overall timing given to finish the paper etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Written Exam Pattern:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing much in the written examination. A candidate just has to prepare the basics of class 6th to 10th in a competition exam manner. It is always easy to prepare for the academic exams as compared to the competitive examination. Join the Drona\'s Academy Online Coaching for SSC GD and get prepared for the exam in a better and effective manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"42\"><col width=\"246\"><col width=\"142\"><col width=\"120\"><col width=\"105\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Part</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Subject</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Duration</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">A</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General Intelligence&nbsp;</p>\r\n<p dir=\"ltr\">Reasoning</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td rowspan=\"4\">\r\n<p dir=\"ltr\">90 minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">B</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General Knowledge&nbsp;</p>\r\n<p dir=\"ltr\">General Awareness</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">C</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Elementary Mathematics</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">D</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">English/ Hindi</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Once a candidate clears the written exam, they will proceed for the Physical Fitness or Physical Efficiency test which is very commonly referred to as PFT.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Army SSC GD Physical Efficiency Test:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"257\"><col width=\"188\"><col width=\"186\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td colspan=\"3\">\r\n<p dir=\"ltr\">Race</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Type</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Male Candidates</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Female Candidates</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Candidates other than&nbsp;</p>\r\n<p dir=\"ltr\">Ladakh Region</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">5 Km in&nbsp;</p>\r\n<p dir=\"ltr\">24 minutes</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 Km in&nbsp;</p>\r\n<p dir=\"ltr\">8(1/2) minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">For Ladakh Region,</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 Km in&nbsp;</p>\r\n<p dir=\"ltr\">6(1/2) minutes</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">800 metres in&nbsp;</p>\r\n<p dir=\"ltr\">4 minutes</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Drona\'s Academy provides better guidance for the Written Examination as well as for the Physical Fitness Test etc. Join SSC GD Online Classes of Drona\'s Academy and clear all your doubts related to the exam and be able to clear the selection stages of the SSC GD vacancy.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', 'ssc31.jpg'),
(15, '10', 'Best Indian Coast Guard GD Coaching Institute In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>The Indian Coast Guard releases separate vacancies for the selection of the sailors into the service. If you are planning for your career in the Indian coast guard as a GD (General Duty) Branch, You need to join the best Indian Coast Guard GD Coaching in India that could train you, prepare you in every manner to clear the examination. There are around three stages of selection that are mandatory to clear for everyone. Let&rsquo;s see the details about the exam, eligibility criteria and selection process etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Exam Details:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"266\"><col width=\"325\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1. Particulars</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Details</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Exam Name</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Coast Guard Recruitment</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Conducting Body</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Coast Guard</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Exam Level</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">National</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Exam mode</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Offline</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">6.Languages</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">English/Hindi</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">7.Exam Fees</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">There is no application fee</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">8.Exam Purpose</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Recruitment of Coast Guard GD</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">9.Exam Helpdesk No.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">+91-22- 24371932 / 24370491</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">10.Exam Website</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.joinindiancoastguard.gov.in</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Eligibility Criteria:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">For the Indian Coast Guard GD (General Duty) Branch, there are some required eligibility criteria that are mandatory to have.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">Educational Qualification</h3>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.A candidate must have passed class 12th with a science stream from a government-recognized board.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.There is also a marks criterion of at least 50% in the class 12th board examination.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.There is also 5% of relaxation in marks for the candidates who have outstanding achievements in Sports.</p>\r\n<h3 dir=\"ltr\" style=\"text-align: justify;\">Age Limit:</h3>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.The age of the candidate must be between 18 years old to 22 years.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.There are also some relaxation has been given to the candidates who belong to SC/ST and OBC categories.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3. 5 years and 3 years of relaxation in age for SC/ST and OBC Candidates.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4. There is nothing much required to apply for the Indian Coast Guard Exam. Join the best Indian Coast Guard GD Coaching Institute in India and get yourself prepared well. The Dronas Academy provides the best education and training for Coast Guard GD Exam. Well, let&rsquo;s see the selection process that one has to clear:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Selection Process:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Stages of the Indian Coast Guard DB consists of the following rounds that are mandatory to clear in every manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Documents Verification</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.Medical Test etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Written Exam is the first and toughest phase of selection. You have to prepare the syllabus till class 12th. Most of the questions would be asked from the syllabus. To get prepared well for your Written Exam, Join the Dronas Academy for the best preparation. Dronas Academy has its own publications of Books and has designed the best book for the Indian Coast Guard Examinations. Our academy provides the Best Indian Coast Guard GD Written Exam Coaching in India. Here are the details about the Coast guard GD Written Exam Pattern.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Written Exam Pattern:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"293\"><col width=\"299\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Exam Details</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"7\">\r\n<p dir=\"ltr\">1.Objective Type</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Physics</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Chemistry</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Mathematics</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">English</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Quantitative Aptitude</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Reasoning</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">General Knowledge</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Language of Paper</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">English and Hindi</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Total Number of Questions</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">80 questions</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Negative Marking</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">No Negative Marking</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Time Duration</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1 hour</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Physical Fitness Test:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">In the Physical Fitness Test, A candidate will appear for the physical activities and on the basis of the performance, marks will be given. Here is the list of the activities that one will appear for:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1. 1.6km of running in 7 minutes etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2. 20 squat ups</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Push-ups etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">For the better preparation of running, you need to run on the track to get better and have to take a proper diet to build stamina and perform better in physical activities.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Coast Guard GD Documents Verification &amp; Medical Test:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Documents verification and medical exam are conducted at the same time. We have a number of students who get rejected in this as well because of the lack of knowledge and guidance. Join the Best Navy Coast Guard Coaching in India that could train you for the Written Exam, Physical Fitness test and as well as for the Medical Exam and other phases, etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Dronas Academy For Coast Guard GD Preparation:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Join the Dronas Academy for the Best Indian Coast Guard Coaching in India and get prepared well for the Written Exam, Physical Fitness Test as well for the medical exam, etc. Our team is qualified and will help you in every manner regarding your selection. We have a well-balanced team of Ex-Coast Guard Officers, Examiners, and Qualified Teachers, etc. We use different tricks to train our candidates physically, mentally and make them eligible to clear the exam. There is nothing that we left in the preparation and could stop you from the selection.</p>', 'indian-coast-guard-navik-2019.jpeg'),
(16, '11', 'Best Navy SSR AA Coaching In India:', '<p style=\"text-align: justify;\"><strong id=\"docs-internal-guid-f3cd7e3d-7fff-49c0-c3ea-4118d76f0e32\">Indian Navy releases a number of vacancies every year to select the candidates in the Indian Navy Service. The SSR and AA is a vacancy through which a candidate gets selected technical and non-technical sailor in the service. This SSR and AA Entry is famous and also have huge competition. You have to join the Best Navy SSR AA Coaching in India that could prepare you in every manner and make you able to clear the examination. The Dronas Academy is one of the reputed institutes in India for the preparation of the defence examinations. Well, let&rsquo;s see the exam details and other information related to the vacancy.</strong></p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy AA SSR Exam Details:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"284\"><col width=\"308\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Exam Name</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Navy SSR/AA</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Organization</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Navy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2. Exam Conducts</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Twice in a year</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Application Form Dates</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.December/January</p>\r\n<p dir=\"ltr\">2. June/July</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.Exam Dates</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.March/April</p>\r\n<p dir=\"ltr\">2.September/October</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">5.Education Qualification</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Senior Secondary</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Eligibility Criteria For Navy SSR &amp; AA:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Only Indian and unmarried candidates are allowed to apply.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Candidates need to have passed class 12th with PCM from any government-recognized board.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Age Limit: The age of the candidate must be between 17 years old to 20 years old.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.There is no relaxation in educational qualification and age limit criteria etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">5.Medical Criteria: A candidate must be medically fit in every manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">6.Physical Criteria: A candidate must be at least 157cm in height with 5cm chest expansion. One should not have any kind of joint defect or any other bones related issues.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">There is nothing required in this section. You have to prepare well in every manner to clear the selection stages in the first round. Join the Best Navy SSR and AA Coaching in India for better preparation and guidance. Let&rsquo;s see the details about the selection stages that a candidate is required to clear:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy SSR AA Selection Process:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">It is marked as mandatory to clear each phase of selection individually. Nobody will have any kind of relaxation in the selection stages.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Exam</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Medical Test etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Written Exam is the first phase of selection that everyone will appear for after the application form. In the Written Exam, One will get asked questions from Mathematics, Science, English and general knowledge etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Only candidates would proceed further, who will clear the Written Exam. Each Phase is tough and you need to join an academy that could prepare you for all three phases of selection and make you able to clear the Navy SSR/AA Entry. Join the Best Indian Navy AA Coaching Center in India, Dronas Academy and get prepared well for the Written Exam, Physical Test and also for Medical Exam etc.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy SSR/AA Written Exam Pattern:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"109\"><col width=\"127\"><col width=\"121\"><col width=\"113\"><col width=\"121\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">S No.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Question</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Marks</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Negative</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Maths</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">0</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">English</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">0</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Science</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">0</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">General Knowledge</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">25</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">0</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Total</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">&nbsp;</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">100</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">0</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection Stages of the Indian Coast Guard DB consists of the following rounds that are mandatory to clear in every manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The competitive exams are always a number of candidates appear for fewer seats. It becomes tough to clear when you are not prepared for it. Join the Dronas Academy that provide the finest Indian Navy SSR Coaching in India and it becomes easy for the candidate to prepare at Dronas Academy under the guidance of the Naval Officers and Qualified teachers etc. Now let&rsquo;s see the details about the Syllabus that a candidate has to prepare for the written exam.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy AA SSR Written Exam Syllabus:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">A candidate has to prepare four subjects for the Indian Navy SSR and AA Written Examination. Here are the subjects:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Mathematics</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.English</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Science</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.General Knowledge etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Dronas Academy has its own publication of books and has designed the best book for the written exam preparation. A single book of Dronas Academy gives complete preparation and makes you able to clear the exam. These books have been designed by the navy Exam Experts and we have got the best result to date.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Join the Dronas Academy to get the Best Navy SSR AA Coaching in India. There is nothing in our preparation that we left. We cover each and every part and prepare mentally to clear the exam.</p>', 'Indian-Navy-Officers-15.jpg');
INSERT INTO `course_details` (`id`, `course_type`, `course_title`, `course_one`, `course_two`, `image`) VALUES
(17, '12', 'Best Indian Navy MR Coaching In India:', '<p dir=\"ltr\" style=\"text-align: justify;\"><strong>In order to join the Indian Navy as an officer or as a sailor, one needs to have passed at least class 12th. But the Indian Navy MR is the only vacancy that is offered after class 10th. Through the Navy MR Vacancy which stands for Matrix Recruits, one can join the galley department in the Indian Navy Service. After the selection, one gets better pay, perks and allowances as per the Indian Navy Standard. Well, the Selection is not as easy. A candidate will have to prepare well and in a different manner to beat the competition. Join the Best Navy MR Coaching in India and get proper education and training regarding the selection. Here are the other details related to the exam like required eligibility criteria and its complete selection process etc.</strong></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>', '<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy MR Vacancy Highlights:</h2>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"280\"><col width=\"312\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Name of Organization</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Indian Navy</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Official Website</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">www.joinindiannavy.gov.in</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Post Name</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Matric Recruits (MR):</p>\r\n<p dir=\"ltr\">1.Chef</p>\r\n<p dir=\"ltr\">2.Steward</p>\r\n<p dir=\"ltr\">3.Hygienist</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Total Number of Vacancies</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">300 (On Average)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Mode of Examination</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Computer-Based Test&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Through the Matrix Recruits, A candidate gets recruited as Chef, Steward and Hygienist etc. Well, It is not easy at all to clear the selection with just basic preparation. You have to prepare enough to beat the competition and get your deserved seats. Join the Best Indian Navy MR Coaching in India and get the proper education and training. Here are the details about each post.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Chef: A chef will be required to prepare the food as per the menu. The food can be vegetarian and non-vegetarian as well. A chef will also have to handle the accounting of ration and other works related to the kitchen. In Addition, there may be some other duties as well.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Stewards: A steward will be responsible to maintain the menu and serving food in the officer&rsquo;s mess. In Addition, there may be some other duties as well.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Sanitary Hygienist: They will be required to maintain cleanliness, hygiene in Kitchen, Washroom and other areas. In Addition, there may be some other duties as well.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Eligibility Criteria For Indian Navy MR Recruitment:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">A candidate needs to have the following criteria to apply for the vacancy:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.A candidate must have passed class 10th from any government recognized board.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.One just needs to have passed; there are no minimum marks criteria.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.The age of the candidate must be between 17 to 20 years old.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">4.There is no relaxation in educational qualification or in age limit has been given to anyone regarding anything.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">Well, it is not that tough to join the service. The Selection in the Indian Navy through the MR is neither tough nor easy. You have to prepare well in order to beat the competition and clear the overall cut off marks. Join the Best Navy MR Coaching Center in India to get prepared well in a very easy manner.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Selection Process Of Indian Navy MR:</h2>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the candidates in the Indian Armed forces is usually done in three phases. For the MR, One has to appear for the following phases of selection:</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">1.Written Exam (Computer-Based Test)</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">2.Physical Fitness Test</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">3.Medical Exam etc</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Selection of the candidates is purely based on the Written Exam and Physical Fitness Test. You have to prepare in a very good manner to get clear on the first attempt. Join the Indian Navy MR Exam Coaching in India which could educate you for the Written Exam and train you for the Physical Fitness Test and make you able to clear the Selection Phase.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy MR Written Exam Pattern:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The Written Exam will be conducted Offline (Pen-Paper Mode). There will be a total of 100 questions in the Examination and one will be given 1 hour to finish the paper.</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"296\"><col width=\"296\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Subjects</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">Total Number of Questions</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.English</p>\r\n</td>\r\n<td rowspan=\"4\">\r\n<p dir=\"ltr\">100 questions</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Science</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Maths</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">4.General Awareness</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</h2>\r\n<h2 dir=\"ltr\" style=\"text-align: justify;\">Indian Navy MR Physical Fitness Test:</h2>\r\n<p style=\"text-align: justify;\"><strong>&nbsp;</strong></p>\r\n<div dir=\"ltr\" style=\"text-align: justify;\" align=\"left\">\r\n<table><colgroup><col width=\"299\"><col width=\"293\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">Categories</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">PFT Details</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">1.Running</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">1.6 Km in Seven Minutes</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">2.Squats</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">20 squats (Uthak-Baithak)</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p dir=\"ltr\">3.Push-ups</p>\r\n</td>\r\n<td>\r\n<p dir=\"ltr\">10 Push-ups</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">&nbsp;</p>\r\n<p dir=\"ltr\" style=\"text-align: justify;\">The preparation of the exam is easy if you join the better institute for preparation. The Dronas Academy is one of the reputed institutes in India for defence exam preparation. It can be very easy for one to get trained at the Dronas Academy under the Ex-Officers and Qualified Teachers. Join the Indian Navy MR Coaching Institute in India and get the best preparation.&nbsp;</p>', 'indian-coast-guard-navik-20191.jpeg');
