INSERT INTO `greeting` (`id`, `message`) VALUES
(1, 'Drona\'s Career Academy is a Team of retired service personal designed the training module to provide students with access to opportunities and tools to succeed in entrance tests in Defence (Army, Navy, Airforce), RPF, State police and all paramilitary forces. Through personalized learning experiences, students learn and master skills needed for the rigorous work of recruitment. To maintain consistent and high quality results, Drona\'s Career Academy tracks students\' performance and outcomes with a balanced Scorecard');
