INSERT INTO `home_page` (`id`, `details`, `image`, `status`) VALUES
(4, '<h5 dir=\"ltr\" style=\"text-align: center; color:#fff\">Seven Core Elements of Dronas Career Academy.</h5>\r\n\r\n<ul>\r\n<li dir=\"ltr\" role=\"presentation\">High standards and clear learning objectives. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Focus on learning and a sense of community. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Balanced curriculum. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Variety of teaching methods. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Rigorous and ongoing assessment. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Assisting, guiding and following up students even after completing the course. &nbsp;&nbsp;</p>\r\n\r\n<li dir=\"ltr\" role=\"presentation\">Building self-confidence and discipline. &nbsp;&nbsp;</p>\r\n</ul>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '65.png', 0);
